import React from 'react';
import './Header.css';
import me from './selfie.jpg';

function Name() {
    return (
        <div className="Name">
            <h1>Bradley Collins Maness</h1>
            <h2>Software Engineering</h2>
        </div>
    );
}

function Portrait() {
    return (
        <img src={me} alt="selfie" />
    );
}

function Header() {
    return (
        <div className="Header">
            <Name />
            <Portrait />
        </div> 
    );
}

export default Header
